import QuoteList from '../quotes/QuoteList';

const DUMMY_QUOTES = [
    { id: 'q1', author: "Mari", text: "Testing App"},
    { id: 'q2', author: "Zaza", text: "Some dymmy text"},
];

const AllQuotes = () => {
    return (
        <QuoteList quotes={DUMMY_QUOTES}/>
    )
};

export default AllQuotes;
